import React from 'react'
import { TextField } from '@material-ui/core'
import { ContainerPrincial } from './styled'

const SignupPage = () => {

    return (

        <ContainerPrincial>
            <h1> Hello </h1>
            <TextField 
                name={"name"}
                label={"Nome"}
                variant={"outlined"}
                fullWidth
                margin={'normal'}
                required
                type={"text"}
                color={"primaryColor"} focused
            /> 

            <TextField
                name={"name"}
                label={"Email"}
                variant={"outlined"}
                fullWidth
                margin={'normal'}
                required
                type={"text"}
                color={"primaryColor"} focused
            /> 

            <TextField
                name={"name"}
                label={"Senha"}
                variant={"outlined"}
                fullWidth
                margin={'normal'}
                required
                type={"text"}
                color={"primaryColor"} focused
            /> 

        </ContainerPrincial>
    )
}

export default SignupPage
